import React from 'react';
import Teamimages from "../Utilities/ImageDirectories/TeamImageDirectory/Teams.json"

function App() {
  const [AllTeamImages, setAllTeamImages] = React.useState([]);

  React.useEffect(() => {
    let newImage;
    for(let i = 0; i < Teamimages.length; i++){
      if(Teamimages[i].team.includes("God's Vineyard")){
        newImage = {url: Teamimages[i].url}
        setAllTeamImages((prevImages) => [...prevImages, newImage])
      }
    }
  }, []);

  return (
    <div className="flex flex-wrap justify-center">
      {AllTeamImages.map((image, index) => (
        <img key={index} src={image[index].url} className="w-96 h-96 object-cover m-4" alt="Team Image" />
      ))}
    </div>
  );
}

export default App;
